import React from 'react';
import PropTypes from 'prop-types';
import google from 'google';

const Main = ({ carModel, hazardRating, path }) => {
    let map = new google.maps.Map(document.getElementById('map'), {
        center: {lat: -34.397, lng: 150.644},
        zoom: 8
    });

    return(
        <div>
            <div className='grid-2'>
                <div>
                    <h1 className='text-primary' style={{ fontSize: '3.5rem', font: 'Candal', fontWeight: 'bolder' }}>Car Model</h1>
                    <body>{carModel}</body>
                </div>
                <div id='map'>
                    {map}
                </div>
            </div>
            <div className='grid-2'>
                <div>
                    <h1 className='text-primary' style={{ fontSize: '3.5rem', font: 'Candal', fontWeight: 'bolder' }}>Hazard Rating</h1>
                    <body>{hazardRating}</body>
                </div>
                <div>
                    <h1 className='text-primary' style={{ fontSize: '3.5rem', font: 'Candal', fontWeight: 'bolder' }}>Shortest Path</h1>
                    <body>{path}</body>
                </div>
            </div>
        </div>
    );
}

Main.propTypes = {
    carModel: PropTypes.string.isRequired,
    hazardRating: PropTypes.number,
    path: PropTypes.string
};

Main.defaultProps = {
    carModel: 'Volkswagen Beetle',
    hazardRating: 0,
    path: ''
};

export default Main;
